import {react, removeUnit, UNITS} from "./Polymer";

const puzzleInput = "";

const reactedPolymer = react(puzzleInput);

console.log("Remaining units:", reactedPolymer.length);

for (let unit of UNITS) {

}

const reactionsWithRemovedUnits = UNITS
    .map((unit) => {
        const removed = removeUnit(puzzleInput, unit);
        const reacted = react(removed);
        return {
            unit: unit,
            unitsRemoved: puzzleInput.length - removed.length,
            sizeAfterReaction: reacted.length
        };
    })
    .sort((leftReaction, rightReaction) => {
        return leftReaction.sizeAfterReaction - rightReaction.sizeAfterReaction
    });
console.log('Smallest size after reduction:', reactionsWithRemovedUnits[0]);
console.log('Biggest size after reduction:', reactionsWithRemovedUnits[reactionsWithRemovedUnits.length - 1]);